import { useDispatch,useSelector} from "react-redux";
import { getPokemonType } from "../Store/action";

export default function MyTeam() {
  const store= useDispatch()
  
  const pokemones=useSelector(store =>store.pokemon.pokemons)
  
  const types =  store(getPokemonType)
 
  return (
  <>
  
   <di>
    <ul>
      {
        pokemones.map(e=>{
          return  <li>name:{e.name}</li>
         
        })
      }
    </ul>
   </di>
  </>

  )
}
